  `user_port` varchar(20) DEFAULT NULL,
  `user_comp_list` text,
  `user_picture` mediumblob,
  PRIMARY KEY (`user_id`),
  KEY `user_name` (`user_name`),
  KEY `user_password` (`user_password`),
  KEY `app_users_FKIndex1` (`user_type`),
  KEY `app_users_FKIndex2` (`ud_id`)
